import React from "react"

export default function Card(props) {
  return (

    <div className="card">
      <img className="img" src="{props.imageUrl}" />
      <h4><i class="fas fa-map-marker-alt"></i> {props.location} <a href="{props.googleMapsUrl}">View on Google maps</a></h4>
      <h1>{props.title}</h1>
      <h3>{props.startDate} - {props.endDate}</h3>
    </div>
  )
}
